<style>
.container { 
height:200vh;
 display: grid;
  grid-template-columns: 1fr 1fr 0.8fr 1fr;
  grid-template-rows: 0.3fr 0.6fr 1.2fr 1.4fr 1.8fr;
  grid-gap:1rem;

grid-area: INFAREP;
border:5px solid cyan;
 }

.nav {

border:5px solid cyan;
 }

.SLIDE-BAR {
border:5px solid cyan;
 grid-area: SLIDE-BAR; }

.DOCTOR {
border:5px solid cyan;
 grid-area: DOCTOR; }

.DASH {
border:5px solid cyan;
 grid-area: DASH; }

.BOARD {
border:5px solid cyan;
 grid-area: BOARD; }

.PATIENTS { 
border:5px solid cyan;
grid-area: PATIENTS; }

.MEDICINE { 
border:5px solid cyan;
grid-area: MEDICINE; }

.CHECKUP { 

border:5px solid cyan;
grid-area: CHECKUP; }

.MEDIACAL-STORE {
border:5px solid cyan; 
grid-area: MEDIACAL-STORE; }

.APPOINMENTS {
border:5px solid cyan; 
grid-area: APPOINMENTS; }

.REPORTS {
border:5px solid cyan;
 grid-area: REPORTS; }
